import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useLocation } from "react-router-dom";
import "@hassanmojab/react-modern-calendar-datepicker/lib/DatePicker.css";
import { Calendar, utils } from "@hassanmojab/react-modern-calendar-datepicker";
import { addToCart } from "../actions/cartActions";

function ModalCalendar(id, staticContext, setreserveddates, ...props) {
  const { onHide } = props;
  const dispatch = useDispatch();

  const carDetails = useSelector((state) => state.carDetails);
  const { car } = carDetails;

  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;

  const [selectedDays, setSelectedDays] = useState([]);

  //transform year, month and day to one string and push to new array
  const reservedDates = [];

  selectedDays.map((item) =>
    reservedDates.push(
      `${item.year}-${item.month > 9 ? item.month : `0${item.month}`}-${
        item.day > 9 ? item.day : `0${item.day}`
      }`
    )
  );

  const disabledDays = [];

  const handleDisabledSelect = (disabledDay) => {
    alert("Tried selecting a disabled day", disabledDay);
  };

  return <div>ModalCalendar</div>;
}

export default ModalCalendar;
